}

#cart-link {
    display: flex;
    align-items: center;
    position: relative;
    transition: transform 0.3s;
}

#top-menu {
    display: flex;
    align-items: center;
    justify-content: center;
    padding-top: 20px;
    
}

#bottom-menu {
    display: flex;
    align-items: center;
    justify-content: center;
}

#brand {
    font-family: serif;
    text-decoration: overline;
    padding-right: 20px;
    padding-top: 0px;
    padding-left: 20px;
    margin-top: 0px;
}

.hero h2{
    color: black;
    font-weight: 200;
    text-align: center;
}

.quantity {
    position: absolute;
    top: -8px;
    right: -16px;
    background-color: red;
    color: white;
    border-radius: 50%;
    padding: 3px 10px;
  }

.hero {
    height: 80vh;
    width: 100%;
    background-color: rgba(0,0,0,0.4);
    padding: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    overflow:hidden;
    position: relative;
    background-size: cover;
}

.wrapper {
    position: relative;
    margin-top: 50px;
    width: 400px;
    height: 440px;
    background: transparent;
    border: 2px solid rgba(255,255,255,.5);
    border-radius: 20px;
    backdrop-filter: blur(90px);
    box-shadow: 0 0 30px rgba(0,0,0,.5);
    display: flex;
    justify-content: center;
    align-items: center;
    overflow: hidden;
    transform: scale(0);
    transition: transform .5s ease, height .2s ease;
}

.wrapper.active-popup {
    transform:scale(1);
}

.wrapper.active {
    height: 520px;
}

.wrapper .form-box _{
    width: 100%;
    padding: 40px;
}

.wrapper .form-box.login {
    transition: transform .18s ease;
    transform: translateX(0);
}

.wrapper.active .form-box.login {
    transition: none;
    transform: translateX(-400px);
}

.wrapper .form-box.register {
    position: absolute;
    transition: none;
    transform: translateX(400px)
}

.wrapper.active .form-box.register {
    transition: transform .18s ease;
    transform: translateX(0);
}

.wrapper .icon-close {
    position: absolute;
    top: 0;
    right: 0;
    width: 45px;
    height: 45px;
    background:transparent;
    color:white; 
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 2em;
    border-style: none;
    padding-top: 10px;
}

.wrapper .icon-close:hover {
    cursor: pointer;
}

.form-box h2 {
    font-size: 2.5em;
    color: #F0F0F0;    
    text-align: center;
}

.input-box {
    position: relative;
    width: 100%;
    height: 50px;
    border-bottom: 2px solid #F0F0F0;
    margin: 30px 0;
}

.input-box label {
    position: absolute;
    top: 50%;
    left: 5px;
    transform: translateY(-50%);
    font-size: 1em;
    color: #F0F0F0;
    font-weight: 500;
    pointer-events: none;
    transition: .5s;
}

.input-box input:focus~label, 
.input-box input:valid~label {
    top: -5px;
}

.input-box input {
    width: 100%;
    height: 100%;
    background: transparent;
    border: none;
    outline: none;
    font-size: 1em;
    color: #F0F0F0;
    font-weight: 600;
    padding: 0 35px 0 5px;
}

.input-box .icon {
    position: absolute;
    right: 8px;
    font-size: 1.2em;
    color: #F0F0F0;
    line-height: 57px;
}

.remember-forgot {
    font-size: .9em;
    color: #F0F0F0;
    font-weight: 500;
    margin: -15px 0 15px;
    display: flex;
    justify-content: space-between;
}

.remember-forgot label input {
    accent-color: #09131B;
    margin-top: -3px;
}

.remember-forgot a {
    color:white;
    text-decoration: none; 
}

.remember-forgot a:hover {
    
    text-decoration: underline;
    
}

.btn {
    width: 100%;
    height: 45px;
    background: transparent;
    border-color: white;
    border-radius: 6px;
    cursor: pointer;
    color: #F0F0F0;
    font-size: 1em;
    font-weight: 500;
}

.login-register {
    font-size: .9em;
    color: #F0F0F0;
    text-align: center;
    font-weight: 500;
    margin: 25px 0 10px;
}

.login-register p a {
    color: #F0F0F0;
    text-decoration: none;
    font-weight: 600;
}

.login-register p a:hover {
    text-decoration: underline;
}

.explore {
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #F0F0F0;
    padding: 100px;
    padding-bottom: 100px;
    flex-direction: column;
}

.explore h2 {
    font-size: 2em;
    font-weight: 600;
}

.explore hr {
    width: 70%;
}

.card {
    height: 300px;
    width: 200px;    
    border-radius: 30px;
    padding: 20px 20px 20px 20px;
}

.card-border {
    border: #f0f0f0;
    border-style: solid;
    margin: 13px;
    border-radius: 30px;
    background-color:#F9F9F9;
    transition: ease-in-out;
    box-shadow: black;
    width: 280px;
    height: 400px;
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
}

.card-border h3 {
    text-align: center;
}

.card-border:hover {
    transform: scale(1.02);
    cursor: pointer;
}

#product-preview {
    background-color: #F0F0F0;
    display: flex;
    justify-content: center;
    padding-bottom: 60px;
    max-width: 100%;
    box-sizing: border-box;
    
}

#product-preview h3 {
    display: flex;
    justify-content: center;
}

#product-preview a {
    text-decoration: none;
}

hr {
